import React from 'react'
import {  useLocation, useNavigate } from 'react-router-dom'
import './Homemainbar.css'
import QuestionList from './QuestionList'



const Homemainbar = () => {

  const user = 1
  const navigate = useNavigate()

  const CheckAuth = () => {
    if(user === null){
      alert('Please Login!')
      navigate('/Auth')
    }
    else{
      navigate('/AskQuestion')
    }
  }

  var questionList=[
    {
      _id:1,
      vote: 3,
      noOfAnswer: 2,
      questionTitle: "What is a function ?",
      questionBody: "It mean to be",
      questionTags:['c','java'],
      userPosted: "Isu",
      askedOn:"1 jun",
      userId: 1,
      answer:[
        {
          answerBody:"answer",
          userAnswered:"khalid",
          answeredOn:"1 jun",
          userId: 2
        }
      ]
    },
    {
      _id:2,
      vote: 2,
      noOfAnswer: 2,
      questionTitle: "What is an arra ?",
      questionBody: "It mean to be",
      questionTags:['c','java'],
      userPosted: "Isu",
      askedOn:"1 jun",
      userId: 2,
      answer:[
        {
          answerBody:"answer",
          userAnswered:"Kyara",
          answeredOn:"1 jun",
          userId: 1
        }
      ]
    },{
      _id:3,
      vote: 3,
      noOfAnswer: 2,
      questionTitle: "What is a function ?",
      questionBody: "It mean to be",
      questionTags:['c','java'],
      userPosted: "Isu",
      askedOn:"1 jun"
    }
  ]

  const location= useLocation()
  return (
    <div className='main-bar'>
      <div className='main-bar-header'>
        {
          location.pathname==='/' ? <h1>Top Questions</h1> : <h1>All Questions</h1>
        }
        <button  className='ask-btn' onClick={CheckAuth}>Ask Question</button>
      </div>
      <div>
        {
          questionList===null ?
          <p>Loading...</p> :
          <>
            <p>{questionList.length} question</p>
            <QuestionList questionList={questionList}/>
          </>
        }
      </div>
      
    </div>
  )
}

export default Homemainbar
